import React from "react";
import CourseRoleComponent from "./CourseRoleComponent";


const course = [
  {
    name: "cs5610",
    term: "20fall",
  },
  {
    name: "cs5200",
    term: "20fall",
  },
  {
    name: "cs4560",
    term: "20fall",
  },
];

const CourseListComponent = ({ instructer, term }) => (
  <div className="container">
    <h1>
      Course List (For {instructer} at {term}){" "}
    </h1>
    <table className="table">
      {
        course.map( course => {
            <CourseRoleComponent item={course}/>
        }

        ) //iterate the elememnt
      }
    </table>
  </div>
);

export default CourseListComponent;
